import React from 'react';

import {Link} from 'react-router-dom'

import './styles.css'

import {FiArrowLeft}from 'react-icons/fi';

import logoImg from '../../assets/LogoDemoShop.svg'; 

import iconImg  from '../../assets/IconCard.svg';

function Pagamento() {
  return (
    <div className="pagamento-container">
    <div className="content">
      <section>
 
       <img src={logoImg} alt="Demo Shop"/>

        <h1>
          <img src={iconImg} alt="Card"/>
          Faça seu cadastro, da ONG hhhhhhhhhhhhhh hhhhhhhhhhhh hhhhhhhhhhhhhhhhh hhhhhhhhhhhhhhhhhhhhhh
        </h1> 
        <p>Faça seu cadastro, da ONG hhhhhhhhhhhhhh hhhhhhhhhhhh hhhhhhhhhhhhhhhhh hhhhhhhhhhhhhhhhhhhhhh</p>

         <Link className="back-link" to="/">
           <FiArrowLeft size={16} color="#E02041" />
                       Não tenho cadastro
         </Link>

      </section>

      {/* <form onSubmit={handleRegister}> */}
      <form >

        {/* <input 
         placeholder="Nome da ONG"
         value={name}
         onChange={e => setName(e.target.value)}
         /> */}
        <input 
         placeholder="Nome da ONG"
         
         />
        {/* <input 
         type="email" 
         placeholder="E-mail"
         value={email}
         onChange={e => setEmail(e.target.value)}
        /> */}
        <input 
         type="email" 
         placeholder="E-mail"
         
        />
        {/* <input 
         placeholder="WhatsApp"
         value={whatsapp}
         onChange={e => setWhatsapp(e.target.value)}
        /> */}
        <input 
         placeholder="WhatsApp"
         
        />

        <div className="input-group">

          {/* <input 
            placeholder="Cidade"
            value={city}
            onChange={e => setCity(e.target.value)}
          />
          <input 
            placeholder="UF" 
            style={{ width:80}}
            value={uf}
            onChange={e => setUf(e.target.value)}
          /> */}

          <input 
            placeholder="Cidade"
            
          />
          <input 
            placeholder="UF" 
            style={{ width:80}}
            
          />

        </div>

        <button className="button" type="submit">Cadastrar</button>

      </form>
    </div>
  </div>
  );
}

export default Pagamento;
